name has-medium-font-size\" style=\"font-style:normal;font-weight:700\">Quality and freshness</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"is-service-description\"} -->\n<p class=\"is-service-description\">At our core, we\'re dedicated to delivering excellence. We take great care in selecting only the finest organic fruits and vegetables, adhering to stringent standards to guarantee optimal freshness and flavor.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"style\":{\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"700\"}},\"className\":\"is-service-name\",\"fontSize\":\"medium\"} -->\n<h3 class=\"wp-block-heading is-service-name has-medium-font-size\" style=\"font-style:normal;font-weight:700\">Community engagement</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"is-service-description\"} -->\n<p class=\"is-service-description\">From fostering partnerships with local farmers to active participation in community events, we\'re deeply committed to supporting initiatives focused on food security, nutrition, and overall well-being.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"calc( 0.25 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\"} -->\n<div style=\"height:calc( 0.25 * var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal)))\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group -->\";s:14:\"disallow_after\";a:0:{}s:12:\"dependencies\";a:0:{}s:10:\"categories\";a:1:{s:22:\"_dotcom_imported_about\";a:3:{s:4:\"slug\";s:22:\"_dotcom_imported_about\";s:5:\"title\";s:22:\"_dotcom_imported_about\";s:11:\"description\";s:0:\"\";}}s:13:\"subcategories\";a:0:{}s:24:\"virtual_theme_cate