("37","woocommerce-WCSubscriptions-June-2023-updated-needed","marketing","en_US","Action required: Security update of WooCommerce Subscriptions","<strong>Your store requires a security update for the WooCommerce Subscriptions plugin</strong>. Please update the WooCommerce Subscriptions plugin immediately to address a potential vulnerability.","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("38","woocommerce-WCReturnsWarranty-June-2023-updated-needed","update","en_US","Action required: Security update of WooCommerce Returns and Warranty Requests extension","<strong>Your store requires a security update for the Returns and Warranty Requests extension</strong>.  Please update to the latest version of the WooCommerce Returns and Warranty Requests extension immediately to address a potential vulnerability discovered on May 31.","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("39","woocommerce-WCOPC-June-2023-updated-needed","update","en_US","Action required: Security update of WooCommerce One Page Checkout","<strong>Your shop requires a security update to address a vulnerability in the WooCommerce One Page Checkout extension</strong>. The fix for this vulnerability was released for this extension on June 13th. Please update immediately.","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("40","woocommerce-WCGC-July-2023-update-needed","update","en_US","Action required: Security update of WooCommerce GoCardless Extension","<strong>Your shop requires a security update to address a vulnerability in the WooCommerce GoCardless extension</strong>. The fix for this vulnerability was released on July 4th. Please update immediately.","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("41","woocommerce-shipping-fedex-api-outage-2023-07-16","warning","en_US","Scheduled FedEx API outage  July 2023","On July 16 there will be a full outage of the FedEx API from 04:00 to 08:00 AM UTC. Due to planned maintenance by FedEx, you\'ll be unable to provide FedEx shipping rates during this time. Follow the link below for more information and recommendations on how to minimize impact.","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("42","wcship-2023-07-hazmat-update-needed","update","en_US","Action required: USPS HAZMAT compliance update for WooCommerce Shipping & Tax extension","<strong>Your store requires an update for the WooCommerce Shipping extension</strong>. Please update to the latest version of the WooCommerce Shipping &amp; Tax extension immediately to ensure compliance with new USPS HAZMAT rules currently in effect.","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("43","woocommerce-WCStripe-Aug-2023-update-needed","update","en_US","Action required: Security update for WooCommerce Stripe plugin","<strong>Your shop requires an important security update for the  WooCommerce Stripe plugin</strong>. The fix for this vulnerability was released on July 31. Please update immediately.","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("44","woocommerce-WCStripe-Aug-2023-security-updated","update","en_US","Security update of WooCommerce Stripe plugin","<strong>Your store has been updated to the latest secure version of the WooCommerce Stripe plugin</strong>. This update was released on July 31.","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("45","woocommerce-WooPayments-Aug-2023-security-updated","update","en_US","Security update of WooPayments (WooCommerce Payments) plugin","<strong>Your store has been updated to the more secure version of WooPayments (WooCommerce Payments)</strong>. This update was released on July 31.","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("46","avalara_q3-2023_noAvaTax","marketing","en_US","Automatically calculate VAT in real time","Take the effort out of determining tax rates and sell confidently across borders with automated tax management from Avalara AvaTax including built-in VAT calculation when you sell into or across the EU and UK. Save time and stay compliant when you let Avalara do the heavy lifting.","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("47","woocommerce-usermeta-Sept2023-productvendors","update","en_US","Your store requires a security update","<strong>Your shop needs an update to address a vulnerability in WooCommerce.</strong> The fix was released on Sept 15. Please update WooCommerce to the latest version immediately. <a href=\"https://developer.woocommerce.com/2023/09/16/woocommerce-vulnerability-reintroduced-from-7-0-1/\" />Read our developer update</a> for more information.","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("48","woocommerce-STRIPE-Oct-2023-update-needed","update","en_US","Action required: Security update for WooCommerce Stripe Gateway","<strong>Your shop requires a security update to address a vulnerability in the WooCommerce Stripe Gateway</strong>. The fix for this vulnerability was released on October 17. Please update immediately.","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("49","amazon-mcf-reviews-2023-12-07","marketing","en_US","Enjoying Amazon MCF for WooCommerce?","We\'re Never Settle, the developers behind Amazon MCF for WooCommerce, and would be deeply honored to have your review. Reviews help immensely as other users can learn how MCF can solve their needs too! Not happy or need help? Please reach out for support and wed love to make things right!","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("50","remove_estimated_deposits_2024","marketing","en_US","Estimated deposits are going away","To provide more accurate deposit information and support the expansion of instant deposits, estimated deposit details will no longer be available in WooPayments. We recommend upgrading to the latest version of WooPayments for more detailed balance status information.","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("51","sirt-woo-2024-11-xss-admin","update","en_US","An important update is required for WooCommerce","This update addresses a security vulnerability that could allow unauthorized access to administrative privileges on your site. <a href=\"https://developer.woocommerce.com/2024/12/03/woocommerce-9-4-3-and-woocommerce-9-3-4-available-now/\">Learn more</a>.\r\n<br><br>\r\n<strong>Please ensure your site is updated to the latest version to stay secure.</strong>","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("52","paypal-braintree-sdk-depreciation-2025-02-20","update","en_US","Update required for your PayPal Braintree extension","To continue securely accepting payments, you must update your PayPal Braintree extension to version 3.2.4 or newer before June 30, 2025. Your current extension version will not support payment processing after this date due to an SSL certificate update.","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("53","uk-vat-notice-2025-04-30","warning","en_US","UK VAT numbers are no longer supported","Due to recent HM Revenue &amp; Customs (HMRC) VAT API changes, your EU VAT Number for WooCommerce extension can no longer validate UK VAT numbers. HMRC now requires merchants to register an API key, which this extension does not currently support. We recommend EU/UK VAT Validation Manager for WooCommerce as a replacement","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("54","paypal-braintree-sdk-depreciation-2025-05-30","update","en_US","Action required: Update the PayPal Braintree extension","Your PayPal Braintree extension is using an outdated SDK and will stop processing payments after June 30, 2025, due to a root SSL certificate expiration. To avoid service disruption, update to version 3.2.4 or newer immediately.","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("55","paypal-carding-recaptcha-jan-26","update","en_US","Fraud protection is now required  enable today","Card networks like Visa and Mastercard now require fraud prevention controls, and non-compliance may result in fines and processing restrictions. Please enable reCAPTCHA in your PayPal Payments settings to help protect your store and maintain compliance.","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("56","reddit_q1_2026","marketing","en_US","Start advertising on Reddit with a $1,000 bonus","Make the most of our new Reddit integration with $1,000 in Reddit Ads! For a limited time, new advertisers who spend $1,000 in Reddit Ads Manager over 30 days will get $1,000 in ad credit. Your bonus credit unlocks automatically when you hit $1,000 in spend. Use your credit within 30 days.","{}","pending","woocommerce.com","2026-02-09 10:43:15",NULL,"0","plain","","0","0","info"),
("57","wc-admin-customizing-product-catalog","info","en_US","How to customize your product catalog","You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.","{}","unactioned","woocommerce-admin","2026-02-11 10:44:34",NULL,"0","plain","","0","0","info"),
("58","wc-admin-launch-checklist","info","en_US","Ready to launch your store?","To make sure you never get that sinking \"what did I forget\" feeling, we\'ve put together the essential pre-launch checklist.","{}","unactioned","woocommerce-admin","2026-02-11 10:44:34",NULL,"0","plain","","0","0","info"),
("59","wc-admin-mobile-app","info","en_US","Install Woo mobile app","Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics  wherever you are.","{}","unactioned","woocommerce-admin","2026-02-11 10:44:34",NULL,"0","plain","","0","0","info"),
("60","Googleupdate_q1_2026","marketing","en_US","Make every ad dollar count","Google for WooCommerce now includes Budget Recommendations. Promote your products across Google  from Search to YouTube and beyond  and get personalized suggestions on where to optimize campaign budgets to reach more shoppers.","{}","pending","woocommerce.com","2026-02-11 10:44:34",NULL,"0","plain","","0","0","info"),
("61","wc-admin-onboarding-payments-reminder","info","en_US","Start accepting payments on your store!","Take payments with the provider thats right for you - choose from 100+ payment gateways for WooCommerce.","{}","unactioned","woocommerce-admin","2026-02-14 11:37:03",NULL,"0","plain","","0","0","info");
